public setDynFields(){
	def l= context.log
	def r= context.current
	l.debug("TRN CUSTOMER - setDynFields() Begin")


	if (r.REF_CUSTOMER_STATUS!=null && r.TO_DOSSIER!=null){
		def showDossiers=true
		if (r.REF_CUSTOMER_STATUS.text=="Prospect")
			showDossiers=false
		r.TO_DOSSIER.show=showDossiers
		if (showDossiers)
			fetchDossiers()
	}
	if (r.TO_CONTACT!=null)
		fetchContacts()

	//if addNewContact has run, clear fields
	l.debug("TMP_CONTACT_ADD:"+r.TMP_CONTACT_ADD.value)
	if (r.TMP_CONTACT_ADD!=null && r.TMP_CONTACT_ADD.value!=null && r.TMP_CONTACT_ADD.value==true){
		r.TMP_CONTACT_ADD=false
		r.TMP_CONTACT_PNOM=""
		r.TMP_CONTACT_NOM=""
		r.TMP_CONTACT_CN=""
		r.TMP_CONTACT_REMARKS=""
		r.TMP_CONTACT_MAIL=""
		r.TMP_CONTACT_TEL=""
	}

	if (r.REF_ORIGIN!=null && r.ORIGIN_MORE!=null){
		if (r.REF_ORIGIN.value==null)
			ORIGIN_MORE.show=false
		else{
			def showMore = r.REF_ORIGIN.toOne.SHOWMORE.value
			l.debug("TRN CUSTOMER - setDynFields() - showMore is:"+showMore)
			ORIGIN_MORE.show= showMore
		}
	}
	l.debug("TRN CUSTOMER - setDynFields() Ends")

}

public addNewContactDyn(){
	def r= context.current
	if (r.TMP_CONTACT_ADD==null){
		context.log.debug("TRN Customer - addNewContactDyn() - Missing field, skipping..")
		return
	}	
	if (r.TMP_CONTACT_ADD.originalValue==true){
		context.log.debug("TRN Customer - addNewContactDyn() - Value was already true, skipping ..")
		return
	}
	if (r.TMP_CONTACT_ADD.value!=true){
		context.log.debug("TRN Customer - addNewContactDyn() - Ticker not ticked, skipping ..")
		return
	}
	context.log.debug("TRN Customer - addNewContactDyn() - Adding One..")
	addNewContact()
	r.refresh()
}
public addNewContactSave(){
	def r= context.current
	def l= context.log
	if (   r.TMP_CONTACT_CN==null || r.TMP_CONTACT_CN.value==null || r.TMP_CONTACT_CN.text==""){
		context.log.debug("TRN Customer - addNewContactSave() - Name is missing. Skipping..")
		context.log.debug("cn:"+r.TMP_CONTACT_CN.text)
		return
	} 
	if ( (r.TMP_CONTACT_MAIL==null || r.TMP_CONTACT_MAIL.value==null) && (r.TMP_CONTACT_TEL==null || r.TMP_CONTACT_TEL.value==null)){
		context.log.debug("TRN Customer - addNewContactSave() - neither mail nor tel filled. Skipping..")
		context.log.debug("mail:"+r.TMP_CONTACT_MAIL.text+"/tel:"+r.TMP_CONTACT_TEL.text)
		return
	}
	addNewContact()
}

public addNewContact(){
	def l= context.log
	def r= context.current
	def myID = r.primaryRowValue


	l.debug("TRN Customer - addNEwContact("+myID+" BEGINS")
	def newLine= context.model.CRM_CUSTOMER_CONTACT.newRecord
	newLine.GN=r.TMP_CONTACT_PNOM.value
	l.debug("TRN Customer - gn:"+r.TMP_CONTACT_PNOM.value)
	newLine.SN=r.TMP_CONTACT_NOM.value
	l.debug("TRN Customer - sn:"+r.TMP_CONTACT_NOM.value)
	newLine.CN=r.TMP_CONTACT_PNOM.value+" "+r.TMP_CONTACT_NOM.value
	l.debug("TRN Customer - cn:"+r.TMP_CONTACT_PNOM.value+" "+r.TMP_CONTACT_NOM.value)
	newLine.TELPRO= r.TMP_CONTACT_TEL.value
	l.debug("TRN Customer - tel:"+r.TMP_CONTACT_TEL.value)
	newLine.MAILPRO= r.TMP_CONTACT_MAIL.value
	l.debug("TRN Customer - mail:"+r.TMP_CONTACT_MAIL.value)
	newLine.REMARKS= r.TMP_CONTACT_REMARKS.value
	l.debug("TRN Customer - remarks:"+r.TMP_CONTACT_REMARKS.value)
	newLine.REF_CUSTOMER= myID

	l.debug("TRN Customer - addNEwContact() - saving new line")
	newLine.save()
	l.debug("TRN Customer - addNEwContact() - saved with id:"+newLine.pkref.value)

	def newJointLine = context.model.CRM_CUSTOMER_CONTACT_COMPANIES.newRecord
	newJointLine.REF_CUSTOMER=myID
	newJointLine.REF_CUSTOMER_CONTACT=newLine.pkref.value
	l.debug("TRN Customer - addNEwContact() - saving joint line!")
	newJointLine.save()
	l.debug("TRN Customer - addNEwContact() - saved!")

	//r.TMP_CONTACT_ADD=true

	l.debug("TRN Customer - addNEwContact() ENDS")

}


public fetchDossiers(){
	def r=context.current
	def l= context.log
	def myKey= r.primaryRowValue
	def m= context.model
	def TBL= m.CRM_CUSTOMER_DOSSIER

	l.debug("TRN Customer - fetchDossiers() BEGINS")
	def count=0

	for (line in r.TO_DOSSIER.arrayItems){
		line.delete()
		count++
	}

	l.debug("TRN Customer - fetchDossiers() - "+count+" lines deleted")
	count=0

	def dbDossiers = TBL.byColumns([(TBL.CUSTOMER):myKey])
	l.debug("TRN Customer - fetchDossiers() - looking for dossier with "+myKey+" as main customer. Found: "+dbDossiers.size())
	for (dossier in dbDossiers) {
		count++
		r.TO_DOSSIER.join(dossier)
	}
	def dbDossiersBis = TBL.byColumns([(TBL.CUSTOMER2):myKey])
	l.debug("TRN Customer - fetchDossiers() - looking for dossier with "+myKey+" as bis customer. Found: "+dbDossiersBis.size())
    for (dossier in dbDossiersBis) {
		count++
		r.TO_DOSSIER.join(dossier)
	}
	dbDossiersTer = TBL.byColumns([(TBL.CUSTOMER3):myKey])
	l.debug("TRN Customer - fetchDossiers() - looking for dossier with "+myKey+" as ter customer. Found: "+dbDossiersTer.size())
    for (dossier in dbDossiersTer) {
		count++
		r.TO_DOSSIER.join(dossier)
	}


	l.debug("TRN Customer - fetchDossiers() - ENDS :"+count+" lines added")

}

public fetchContacts(){
	def r=context.current
	def l= context.log
	def myKey= r.primaryRowValue
	def m= context.model
	def TBL= m.CRM_CUSTOMER_CONTACT_COMPANIES


	l.debug("TRN Customer - fetchContacts() BEGINS")
	if (TBL==null)
		l.debug("Could not find crm_customer_contact_companies")
	def count=0

	for (line in r.TO_CONTACT.arrayItems){
		line.delete()
		count++
	}

	l.debug("TRN Customer - fetchContacts() - "+count+" lines deleted")
	count=0

	def dbContacts = TBL.byColumns([(TBL.REF_CUSTOMER):myKey])
    for (contactCompanyLine in dbContacts) {
		def contactID=contactCompanyLine.REF_CUSTOMER_CONTACT.value
		l.debug("TRN Customer - fetchContacts() - adding line:"+contactID)
		count++
		r.TO_CONTACT.join(contactID)
	}

	l.debug("TRN Customer - fetchContacts() - ENDS :"+count+" lines added")

}

