//CHC Dossier / Soncultant

public getChoices() {
	def r= context.current
	def m= context.model
	def l= context.log
	def TBL= m.CRM_OFFER_STAFF
	def originalValue = null
	def found=0
	def choices = new ArrayList<>()

	// if no offer is provided, list of consultant is empty
	if (r.REF_DOSSIER_OFFER==null || r.REF_DOSSIER_OFFER.value==null){
		choices << Choice.create('blabla', 'blabla', true)
		return choices
	}

	// Data from current record
	originalValue = r.REF_STAFF.value
	def offerID=r.REF_DOSSIER_OFFER.value


	//find relevant staff
	def relevantStaff = TBL.byColumns ( [ (TBL.ref_offer): offerID])

	//Add staff to choices
	for (staff in relevantStaff){
		found++
		def staffID = staff.REF_STAFF.value
			if (staffID==null) continue
		def staffLine = context.model.CRM_STAFF.byID(staffID)
		def staffName='someone'
		if (staffLine!=null && staffLine.cn!=null && staffLine.cn.value!=null)
			staffName=staffLine.cn.value
		choices << Choice.create(staffID, staffName, staffID==originalValue)
	}

	//If there is only one availble staff, select it
	if (found==1)
		choices[0].selected(true)

	return choices


}

