public getActionsList() {
	context.log.debug("TRN DOSSIER getactionslist")
	if (context.current==null) context.log.debug("TRN DOSSIER - record is null")
	def actions = context.actions;
	def onFiche= context.eventSource!='list'
	if (onFiche){
		def TBL = context.model.CRM_WORKFLOW_PRIVILEGES //defined here to bypass later problem
		//fetch Button list
		context.model.CRM_WORKFLOW_BOUTONS.query.each(){
			// ligne: it
			def techName = it.TECHNICAL_NAME.value
			Integer techID = it.PKREF.value
			def libelle = it.LABEL.text
			def iconChoice = it.ICON.text
			def previous = it.PREVIOUS_STATE.value
			def currentState= -1
			if (context.current!=null && context.current.ref_WORKFLOW_STATE!=null)
				currentState=context.current.REF_WORKFLOW_STATE.value
			//context.log.debug("Ligne Bouton: techname:"+techName+"/Libelle:"+libelle+"/icone:"+iconChoice+"/pkref:"+techID+"/state:"+previous+"/current:"+currentState)
			def matchingState=   (previous==currentState) 
			actions.add(techName, libelle, getIcon(iconChoice), {matchingState && showRights(TBL,techID) })
		}
		context.log.debug("TRN Dossier getactionslist ends")
	}
//	A titre d'exemple...
//	actions.add('conventionSignee', 'Convention Signée', media.icons.check, {showRights('conventionSignee')});
    return actions;
}



public showRights(TBL,techID){

	// droits systématiques
	if (context.user.login=="admin")
		return true
	if (doUserHaveProfile("Workflow superuser"))
		return true

	if (TBL==null)
		context.log.debug("BTN Dossier - showRights("+techID+") - CRM_WORKFLOW_PRIVILEGES could not be opened by context.model ?")
	def privs = TBL.byColumns([(TBL.REF_WORKFLOW_BOUTON):techID])

	for (priv in privs){
		if (doUserHaveProfile(priv.PROFILE.text))
			return true
	}
	return false

}

public getIcon(iconChoice){
	switch(iconChoice){
		case "nope":
			return media.icons.close
			break
		case "verify":
			return media.icons.clipboard_paste
			break
		case "send":
			return media.icons.mail
			break
		default:
			return media.icons.check
	}

	return media.icons.check
}

