public nextEtape(boutonTechName){
	//aller chercher l'étape suivante
	//l'assigner dans ref_WORKFLOW_STATE
	def r= context.current
	def l= context.log
	def TBL=context.model.CRM_WORKFLOW_BOUTONS
	def nextState=-1
	def sendNotificationFlag = false
	def sendMailFlag = false
	def currentState=r.REF_WORKFLOW_STATE.value
	def boutonId
	def actionLabel
	def target_customer_status
	def optional_status=false


	l.debug("BTN DOSSIER - nextEtape " + boutonTechName)
	def boutonLines = TBL.byColumns([(TBL.TECHNICAL_NAME): boutonTechName])
	for (boutonLine in boutonLines){
		if (boutonLine.NEXT_STATE!=null && boutonLine.NEXT_STATE.value!=null)
			nextState=boutonLine.NEXT_STATE.value
		sendNotificationFlag = boutonLine.SENDS_TASK.value
		actionLabel = boutonLine.LABEL.value
		sendMailFlag = boutonLine.SENDS_MAIL.value
		boutonId = boutonLine.pkref.value
		if (boutonLine.TARGET_CUSTOMER_STATUS!=null) 
			target_customer_status = boutonLine.TARGET_CUSTOMER_STATUS.value
		if (boutonLine.TARGET_CUSTOMER_STATUS_WEAK!=null)
			optional_status= boutonLine.TARGET_CUSTOMER_STATUS_WEAK.value
		//History
		l.debug("BTN DOSSIER - nextEtape - History tracking")
		def historyLine= r.WORKFLOW_HISTORY.join()
		l.debug("BTN DOSSIER - nextEtape - History line created")
		def dt= new java.sql.Time(System.currentTimeMillis())
		historyLine.dttracking= dt
		l.debug("BTN DOSSIER - nextEtape - History date added")
		historyLine.ref_user=context.user.UUID
		l.debug("BTN DOSSIER - nextEtape - History associated with user")
		historyLine.ref_WORKFLOW_BOUTON=boutonId
		l.debug("BTN DOSSIER - nextEtape - History associated with bouton")

	}
	if (nextState!=-1)
		r.REF_WORKFLOW_STATE=nextState
	r.save()

	if(sendNotificationFlag) {
		def TBL_recipient = context.model.CRM_WORKFLOW_TASK_RECIPIENTS
		def recipients = TBL_recipient.byColumns([(TBL_recipient.ref_WORKFLOW_BOUTON):boutonId])
		for (recipient in recipients){
			def recipientId = recipient.ref_sys_user.value
			sendNotification(recipientId, actionLabel)
		}
	}
	if(sendMailFlag) {
		def TBL_recipient = context.model.CRM_WORKFLOW_RECIPIENT
		def recipients = TBL_recipient.byColumns([(TBL_recipient.ref_WORKFLOW_BOUTON):boutonId])
		for (recipient in recipients){
			def recipientId = recipient.ref_sys_user.value
			sendMail(recipientId,currentState,boutonId,actionLabel)
		}
	}
	if (target_customer_status!=null){
		boolean doIt=true
		if (optional_status)
			doIt= isThereOtherDossier(customerID)
		if (doIt){
			def TBL_CST = context.model.CRM_CUSTOMER
			def customerLine= context.current.CUSTOMER.toOne
			if (customerLine!=null){
				customerLine.REF_CUSTOMER_STATUS=target_customer_status
				customerLine.save()
				l.debug("BTN Dossier - nextEtape() - updated customer record ")
			}
		}
	}

	/*
	def task = context.task.title('Titre de la tâche').to(user1).record(data)
	task.content("Une tâche de ${context.user} pour ${to} !")
	task.create()*/
}

public sendNotification(recipientId, actionLabel){
	def r = context.current
	def l = context.log
	def user = context.getUser(recipientId)
	def content = "Ce dossier vient d'être noté: "+actionLabel+"."
	def title = "Un dossier a avancé!"

	l.debug("BTN Dossier - sendNotification: " + recipientId)
	def task = context.task.title(title).to(user).record(r).content(content)
	task.create()

}

public sendMail(recipientId,currentState,boutonId, actionLabel){
	def r = context.current
	def l = context.log
	def user = context.getUser(recipientId)
	def nom = user.surName
	def prenom = user.givenName
	def mail = user.mail
	def refDossier = r.primaryRowValue
	l.debug("BTN Dossied - SendMail (" + recipientId + ", " +currentState + ", " + boutonId+")")

	def outbox = context.model.CRM_WORKFLOW_OUTBOX

	def body = "Bonjour Valérie \n"
	body+= "Le dossier \""+r.LABEL.value+"\" du client "+r.customer.toOne.LABEL.value+" a été déposé.\n"
	body+= "Tu peux faire la facture de solde.\n\n"
	body+= "Bonne journée!\n\n"
	body+= "lien direct: https://litz.reflexe.fr/front/#v1842336813/"+refDossier



	def newMail = outbox.newRecord
	newMail.sender = "reflexe"
	newMail.subject = "Dossier déposé"
	newMail.mailBody = body
	newMail.email = mail

	newMail.save()

}


public boolean doUserHaveProfile(String seekedProfile){
	boolean retour=false
	context.user.allProjectsRoles.each() {
		if (it.getLabel(Locale.FRENCH)==seekedProfile)
			retour=true
	}
	return retour
}

