public setDynFields(){
	def l= context.log
	def r= context.current

	//Trame is abandonned so...
	//makeTrameGoPouf()
//	setupTrame() // runs everytime: optimisation possible
//	fillTrameCopy()

	//Back to your programs...
	fillOffer()

	if (r.sav_STAFFNAME!=null && r.REF_STAFF!=null && r.REF_STAFF.value!=null){
		r.SAV_STAFFNAME=r.REF_STAFF.text
	}

	setControlStatus()

	if(r.ref_workflow_state != null && r.ref_workflow_state.value == null){
		r.ref_workflow_state = 'Attente signature convention'
	}

	//ACCOMPTES show
	if (r.DPMODE!=null  && r.DP1!=null && r.DP2!=null && r.DP3!=null){
		def show1=false
		def show2=false
		def show3=false
		switch(r.DPMODE.value){ //warning switch with no breaks
			case 'AC3':
				show3=true
			case 'AC2' :
				show2=true
			case 'AC1' :
				show1=true
		}
		r.DP1.show=show1
		r.DP2.show=show2
		r.DP3.show=show3
	}
	//BALANCE ok = ALL DP ok
	if(r.BALANCE!=null && r.BALANCE.value!=null && r.DP1!=null && r.DP2!=null && r.DP3!=null){
		if (r.BALANCE.value==true){
			r.DP1=true
			r.DP2=true
			r.DP3=true
		}
	}

	//show relevant customer fields
	if (r.CUSTOMER!=null && r.CUSTOMER2!=null && r.CUSTOMER3!=null){
		r.CUSTOMER2.show= r.CUSTOMER.value!=null
		r.CUSTOMER3.show= r.CUSTOMER2.value!=null
	}

	if (TR_NEXTRDV!=null && DOSSIER_ACTIONS!=null)
		fetchNextAction()

	r.ZIP_FILE_DATA.show=false
	r.ZIP_FILE_NAME.show=false
	r.ZIP_FILE_TYPE.show=false

	fillEmptyWorkfileFields()
}


public fillEmptyWorkfileFields(){
	def r= context.current
	def l= context.log

//	l.debug("TRN DOSSIER  - fillEmptyWorkfileFields() - BEGINS")

	def today= new Date()
	def changed=false

	if (r.WORK_FILES!=null){

		for (line in r.WORK_FILES.arrayItems){
			 if (line.LABEL !=null && line.LABEL.value!=null){

				if (line.DTFILE!=null && line.DTFILE.value==null)
					line.DTFILE=new Date()
//				l.debug("TRN DOSSIER WORKFILES - fillEmptyWorkfileFields - setting dt to: "+line.DTFILE.value)

				if (line.REF_FILE_STATUS!=null && line.REF_FILE_STATUS.value==null)
					line.REF_FILE_STATUS='1- Non contrôlé'
	//			l.debug("TRN DOSSIER WORKFILES - fillEmptyWorkfileFields - status set to : "+line.REF_FILE_STATUS.text)
				 changed=true
			}
		}
		if (changed)
			r.WORK_FILES.saveArray()
	}
}


public fetchNextAction(){
	def r=context.current
	def l= context.log
	def result=null

	if (r.DOSSIER_ACTIONS.arrayItems.empty){
		l.debug(" TRN Dossier - fetchNextAction - array is empty. Skipping")
	}
	else{
		l.debug(" TRN Dossier - fetchNextAction - BEGINS")
		for (line in r.DOSSIER_ACTIONS.arrayItems){
			if (result==null && line.DTACTION.value!=null){
				result=line.DTACTION.value
				l.debug(" TRN Dossier - fetchNextAction - first line, no test")
			}
			else{
				if (line.DTACTION.value<result){
					l.debug(" TRN Dossier - fetchNextAction - tested "+line.DTACTION.value+" > "+result+" ... ok ?")
					result=line.DTACTION.value
				}
			}
		}
	}
	r.TR_NEXTRDV=result

}

