	def r= context.current
	def m= context.model
	def TBL= m.CRM_CUSTOMER_CONTACT_COMPANIES

	l.debug("TRN Dossiers - fillInterlocuteurs() - BEGINS ")

	if (r.CONTACTS!=null && r.CUSTOMER!=null && r.CUSTOMER2!=null && r.CUSTOMER3!=null){

		//Erase array
		for (line in r.CONTACTS.arrayItems)
			line.delete()

		if (r.CUSTOMER.value!=null){
			def contacts = TBL.byColumns([(TBL.REF_CUSTOMER): r.CUSTOMER.value])
			l.debug("TRN Dossiers - fillInterlocuteurs() - customer1: "+contacts.size())
			for(contactLine in contacts){
				def contact= contactLine.REF_CUSTOMER_CONTACT.value
				r.CONTACTS.join(contact)
			}
		}
		if (r.CUSTOMER2.value!=null){
			def contacts = TBL.byColumns([(TBL.REF_CUSTOMER): r.CUSTOMER2.value])
			l.debug("TRN Dossiers - fillInterlocuteurs() - customer2: "+contacts.size())
			for(contactLine in contacts){
				def contact= contactLine.REF_CUSTOMER_CONTACT.value
				r.CONTACTS.join(contact)
			}
		}
		if (r.CUSTOMER3.value!=null){
			def contacts = TBL.byColumns([(TBL.REF_CUSTOMER): r.CUSTOMER3.value])
			l.debug("TRN Dossiers - fillInterlocuteurs() - customer3: "+contacts.size())
			for(contactLine in contacts){
				def contact= contactLine.REF_CUSTOMER_CONTACT.value
