	for (i=1 ; i<16 ; i++){
		l.debug("TRN DOSSIER - saveTramefile("+i+") testing if save is relevant")
		def trameFieldName = r.get("TRAMEDATA_NAME_"+Integer.toHexString(i))
		def trameFieldFileBinary = r.get("TRAMEDATA_FILE_"+Integer.toHexString(i))
		if (trameFieldName==null || trameFieldName.value==null || trameFieldName.value.isEmpty()) continue
		if (trameFieldFileBinary==null || trameFieldFileBinary.value==null || trameFieldFileBinary.value.length==0) continue
		l.debug("TRN DOSSIER - saveTrameFile for "+trameFieldName.value)
		if (trameFieldFileBinary.updated){
			copyTrameFileToWorkFiles(trameFieldName.value, trameFieldFileBinary)
		}
		else{
			l.debug("TRN DOSSIER - saveTrameFile() - Trame field not updated")
		}
	}
	fileArray.saveArray()


}


public initTrame(){
	def r= context.current
	def l= context.log
	def template= r.REF_DOSSIER_TEMPLATE.toOne
	def templateID= r.REF_DOSSIER_TEMPLATE.value
	l.debug("TRN DOSSIER - initTrame() BEGINS")

	if (template==null){
		l.debug("TRN Dossier - initTrame() - template is null")
		return
	}
	for (int i=1 ; i<16 ; i++){
		//Scan Fields from xx_1 to xx_F
		def trameFieldName = r.get("TRAMEDATA_NAME_"+Integer.toHexString(i))
		def trameFieldSVal = r.get("TRAMEDATA_SVAL_"+Integer.toHexString(i))
		def trameFieldLVal = r.get("TRAMEDATA_LVAL_"+Integer.toHexString(i))
		def trameFieldFileBinary = r.get("TRAMEDATA_FILE_"+Integer.toHexString(i))
		def trameFieldFileStatus = r.get("TRAMEDATA_FSTATUS_"+Integer.toHexString(i))
		def trameFieldFileFiller = r.get("TRAMEDATA_FILLER_"+Integer.toHexString(i))

		String templateLabel= template.get("TRAMEDATA_LABEL_"+Integer.toHexString(i)).text
		if (templateLabel!=null && !templateLabel.isEmpty()){
			//l.debug("TRN Dossier - initTrame() - Trame #"+i+" ("+templateLabel+") is not empty.. building")
			String templateSize = template.get("TRAMEDATA_SIZE_"+Integer.toHexString(i)).text
			boolean templateHasFile = template.get("TRAMEDATA_FILE_"+Integer.toHexString(i)).value
			//def templateDefaultFile = template.get("TRAMEDATA_DEFAULTFILEDATA_"+Integer.toHexString(i)).value //Remplacer par SQL (getBytes renvoie un Bytes[])  et envoyer le résultat au setValue
			if (trameFieldName==null){
				l.warn("TRN Dossier - initTrame() - filed missing: TRAMEDATA_NAME_"+Integer.toHexString(i))
				continue
			}
			trameFieldName.setValue(templateLabel)
			if (templateSize!=null){
				def isShort= "short".equalsIgnoreCase(templateSize)
				trameFieldSVal.show=isShort
				trameFieldSVal.setValue('-')
				trameFieldLVal.show=!isShort
				trameFieldLVal.setValue('-')
			}

			if (templateHasFile==true){
				trameFieldFileBinary.show=true
				trameFieldFileStatus.show=true
				trameFieldFileFiller.show=true

				trameFieldFileStatus.setValue('En cours')
				def templateDefaultFile = getDefaultFile(templateID, Integer.toHexString(i)) 
				if (templateDefaultFile!=null && templateDefaultFile.length!=0)
					l.debug("TRN Dossier - initTrame() - received non empty defaultFile for index:"+i+". Size is "+templateDefaultFile.length)
					trameFieldFileBinary.setValue(templateDefaultFile)
			}
			else{
				trameFieldFileBinary.show=false
				trameFieldFileStatus.show=false
				trameFieldFileFiller.show=false
			}
		}
		else{
			trameFieldName.show=false
			trameFieldSVal.show=false
			trameFieldLVal.show=false
			trameFieldFileBinary.show=false
			trameFieldFileStatus.show=false
			trameFieldFileFiller.show=false
		}
	}
	l.debug("TRN DOSSIER - initTrame() ENDS")	
}

