public getDefaultFile(templateID, trameItemIndex){
	def l=context.log
	String fieldName= "TRAMEDATA_DEFAULTFILEDATA_"+trameItemIndex
	String query= " select "+fieldName+" from CRM_DOSSIER_TEMPLATE where PKREF= ? "
	def retour = []
	int lines=0

	l.debug ("TRN DOSSIER - getDefaultFile - attepting to get default file "+templateID+" with "+query+" ("+templateID+")")
	PreparedStatement stmt= null
	ResultSet rset= null
	def availableConnection = context.connectionAvailable

	try{
		if (availableConnection) {
			conn= context.connection
			//l.debug("TRN DOSSIER - getDefaultFile()  - Connection by context")
		}
		else{
			conn= context.runtime.connection
			//l.debug("TRN DOSSIER - getDefaultFile() - Connection by runtime")
		}

		stmt = conn.prepareStatement(query)
		stmt.setInt(1,templateID)
		rset = stmt.executeQuery();

		while (rset.next()){
			retour=rset.getBytes(1)
			lines++
		}
	}
	catch(SQLException e){
		l.debug("Unable to acces data for "+fieldName+". Because:"+e)
	}
	finally{
		if (!availableConnection)
			conn.close()
	}

	l.debug("TRN DOSSIER - getDefaultFile("+trameItemIndex+") - nblines:"+lines)
	l.debug("TRN DOSSIER - getDefaultFile("+trameItemIndex+") - Size of retour:"+retour?.length)
	return retour
}


