public setCustomer(){
	def r= context.current
	def l= context.log

	if (r.ref_customer_contact==null || r.REF_CUSTOMER_CONTACT.value==null){
//		l.debug("TRN TODOCLIENT - setCustomer() aborts: no contact")
		return
	}
	if (r.REF_CUSTOMER==null){
//		l.debug("TRN TODOCLIENT - setCustomer() aborts: no customer field to fill")
		return
	}

	def m= context.model
	def TBL= m.CRM_CUSTOMER_CONTACT_COMPANIES

	def companies =""
	def first=true

	def liens = TBL.byColumns([(TBL.REF_CUSTOMER_CONTACT): r.REF_CUSTOMER_CONTACT.value])
//	l.debug("TRN TODOCLIENT - setCustomer() loop: found "+liens.size()+" links contact<->customer")
	for(lien in liens){
		def companyID= lien.REF_CUSTOMER.value
//		l.debug("TRN TODOCLIENT - setCustomer() loop: found: "+companyID)
		if (companyID==null){
			l.warn("TRN TODOCLIENT - this should not happen: dead link (call zelda)")
			return
		}
		def companyName= lien.REF_CUSTOMER.toOne.LABEL.value
//		l.debug("TRN TODOCLIENT - setCustomer() loop: found: "+companyName)
		if (!first) companies+="/"
		first=false
		companies+=companyName
	}
	r.REF_CUSTOMER= companies


}

